    if(props.img) {
        divElement = <div className={`${props.className} profile-img profile-img--picture`}></div>
    } else {
        divElement =<div className={`${props.className} profile-img profile-img--color`}></div>
    }

    return (
        divElement
    )
}

export default ProfileImage;
